import React from "react";
import { Button } from "react-native";

export default function Login() {
  const handleLogin = () => {};

  return (
    <Button
      onPress={handleLogin}
      title="Login"
      color="#841584"
      accessibilityLabel="Learn more about this purple button"
    />
  );
}
